import React from 'react';
import '../css/SectionB.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faArrowRight} from '@fortawesome/free-solid-svg-icons';

const SectionB = () => {
    return (
        <div>
            <div className='row'>
                <div className='col-6'>                 
                   <p>Portable indispensables</p>
                   <p className='content'>These skin, hair and body care formulations are suitably sized to refresh frequent travellers en route and at destination. </p>
                   <button type="button" class="button button1">Browse gifts for travel {<FontAwesomeIcon icon={faArrowRight}/>}</button>
                </div>
                  <div className='imgbg col-6'>
                    <img src="https://www.aesop.com/u1nb1km7t5q7/7FCpperJ9RxcwrxLV32w0K/2340610bf80421506883d758f777915e/Aesop_Gift_Kits_2021_Web_Homepage_2_Primary_Product_Overlay_Desktop_Tablet_800x640px.png" className="sprayimg"alt="img"/>
                  </div>
                </div>
        </div>
    )
}

export default SectionB;
